import './Footer.css';


export default function Footer(){

    return(
        <div className="Footer">

<MediaLink imageUrl='https://cdn-icons-png.flaticon.com/128/2504/2504911.png' name='Github'/>

<MediaLink imageUrl='https://cdn-icons-png.flaticon.com/128/2504/2504911.png' name='LinkedIn account'/>

            <span>
                <img className='AccountsImg'src="https://cdn-icons-png.flaticon.com/128/2504/2504923.png" alt="" />
                <h3>LinkedIn</h3>
            </span>
        </div>
    );
}


function MediaLink(porp){

    return <span>
    <img className='AccountsImg' src={porp.imageUrl} alt={porp.name} />
    <h3>{porp.name}</h3>
</span>
}
